css:
@-moz-document domain("github.com") {
/*
Primary Color: #800080
Hover Color: #670067
Text Color: #000/#FFF
Dark/Light Mode: Dark/Light
Dark Background Colors: #191919, #262626, #333333, #3F3F3F, #4C4C4C
Light Background Colors: #FFFFFF, #F2F2F2, #E5E5E5, #D8D8D8, #CCCCCC
*/
:root {
	--primary-color: /*[[primary-color]]*/;
	--primary-hover-color: /*[[primary-hover-color]]*/;
}
/*[[dark-mode-off]]*/
body, html {
    margin: 0;
    display: flex;
    align-items: stretch;
    width: 100%;
}
body {
    color: #a2a2a2;
    flex-direction: row;
    overflow: hidden;
    font-family: 'Karla', sans-serif;
    height: 100%;
    position: absolute;
}

/* Front page */

div#js-pjax-container {
width: 100%;
}

div#dashboard {
width: 100%;
}

.dashboard .Box.Box--condensed {
position: relative;
left: -1px;
}

/* END Front page*/
/* Main Bar */
.Header {
background-color: transparent;
width: 75px;
transition: 0.1s linear width, opacity 0.1s linear;
position: relative;
z-index: 100;
height: 100%;
}
.Header .header-search-input::placeholder {
color: #ccc;
}
.Header .header-search-wrapper {
color: #000;
background-color: transparent;
border-bottom: 2px solid #484848;
border-radius: 0px;
transition: 0.2s linear border-bottom;
}
.Header .header-search-wrapper:hover {
border-bottom: 2px solid var(--primary-color);
}
.Header .header-search-wrapper.focus {
background-color: rgba(255, 255, 255, 0.07);
box-shadow: none;
}
.Header .jump-to-suggestions {
display: none;
}
.Header .jump-to-field-active {
background-color: transparent !important;
border-radius: 0px;
}
.Header .jump-to-field-active::placeholder {
color: #fff !important;
}
.Header .header-logo-invertocat {
position: absolute;
bottom: 8px;
left: 0%;
width: 100%;
margin: 0 auto;
}
.Header .header-logo-invertocat .octicon-mark-github {
float: unset;
height: 50px;
width: 50px;
position: unset;
margin: 0 auto;
display: block;
transition: 0.1s linear width, 0.1s linear height;
}
.Header .HeaderMenu.d-flex.flex-justify-between.flex-auto {
flex-direction: column;
width: 164px;
}
.Header .HeaderMenu.d-lg-flex.flex-justify-between.flex-auto {
width: 100%;
}
.Header .HeaderMenu ul#user-links.user-nav::before {
visibility: hidden;
}
.Header .HeaderMenu .header-search {
z-index: 3;
width: 0px !important;
left: 53px;
transition: 0.1s linear width, 0.1s linear left;
}
.Header .HeaderMenu .header-search::before {
content: "";
background-image: url("data:image/svg+xml;utf8,<svg width='24' height='24' xmlns='http://www.w3.org/2000/svg'><g><title>background</title><rect fill='none' id='canvas_background' height='402' width='582' y='-1' x='-1'/></g><g><title>Layer 1</title><path fill='#d3d4d5' id='svg_1' d='m15.5,14l-0.79,0l-0.28,-0.27c0.98,-1.14 1.57,-2.62 1.57,-4.23c0,-3.59 -2.91,-6.5 -6.5,-6.5s-6.5,2.91 -6.5,6.5s2.91,6.5 6.5,6.5c1.61,0 3.09,-0.59 4.23,-1.57l0.27,0.28l0,0.79l5,4.99l1.49,-1.49l-4.99,-5zm-6,0c-2.49,0 -4.5,-2.01 -4.5,-4.5s2.01,-4.5 4.5,-4.5s4.5,2.01 4.5,4.5s-2.01,4.5 -4.5,4.5z'/><path id='svg_2' fill='none' d='m0,0l24,0l0,24l-24,0l0,-24z'/></g></svg>");
display: -webkit-box;
height: 23px;
width: 23px;
background-size: 23px;
background-repeat: no-repeat;
background-position: center;
position: absolute;
top: 6px;
right: 10px;
}
.Header .HeaderMenu > div.d-flex {
flex-direction: column;
}
.Header .HeaderMenu > div.d-flex ~ div.d-flex .user-nav {
flex-direction: column;
}
.Header .HeaderMenu .user-nav .dropdown:nth-child(1) .octicon {
left: 18px;
position: relative;
}
.Header .HeaderMenu .user-nav .dropdown {
width: 100%;
}
.Header .HeaderMenu .user-nav .dropdown .avatar {
margin-right: 23px !important;
position: relative;
left: 5px;
}
.Header .HeaderMenu .user-nav .dropdown .details-overlay .name {
font-size: 0px !important;
}
.Header .HeaderMenu .user-nav .dropdown .details-overlay .name::after {
content: "Account";
}
.Header .HeaderMenu .user-nav .dropdown .details-overlay .name .dropdown-caret {
display: none;
}
.Header .HeaderMenu .user-nav .dropdown .details-overlay summary {
width: 100%;
}
.Header .HeaderMenu .user-nav .dropdown .details-overlay summary.HeaderNavlink {
padding: 18px 0 18px 20px;
font-size: 15px;
font-weight: 400;
}
.Header .HeaderMenu .user-nav .dropdown .details-overlay summary.HeaderNavlink:not(.name)::after {
content: "Setting";
font-size: 0px !important;
}
.Header .HeaderMenu .user-nav .dropdown .details-overlay summary:hover {
background-color: #2d333a;
}
.Header .HeaderMenu .d-lg-flex ul li::before {
margin-right: 30px;
position: relative;
left: 4px;
opacity: 0.8;
}
.Header .HeaderMenu .d-lg-flex ul li:hover {
background-color: #2d333a;
}
.Header .HeaderMenu .d-lg-flex ul li a.HeadeNavlink {
width: 100%;
padding: 18px 0 18px 20px !important;
font-weight: 400;
font-size: 0px !important;
}
.Header .HeaderMenu .d-lg-flex ul li a.HeadeNavlink::before {
margin-right: 30px;
position: relative;
left: 4px;
opacity: 0.8;
}
.Header .HeaderMenu .d-lg-flex ul li:hover a.HeadeNavlink::before {
opacity: 1;
}
.Header .HeaderMenu ul.d-flex.pl-2.flex-items-center.text-bold.list-style-none::before,
.Header .HeaderMenu ul.d-lg-flex.pl-lg-2.flex-items-center.text-bold.list-style-none::before,
.Header .HeaderMenu ul#user-links.user-nav::before {
color: rgba(255, 255, 255, 0.5);
position: relative;
font-size: 18px;
margin-bottom: 15px;
font-weight: 500;
left: -100px;
}
.Header .HeaderMenu ul.d-flex.pl-2.flex-items-center.text-bold.list-style-none::before,
.Header .HeaderMenu div:nth-child(1) ul#user-links.user-nav::before,
.Header .HeaderMenu ul.d-lg-flex.pl-lg-2.flex-items-center.text-bold.list-style-none::before {
content: "MAIN";
}
.Header .HeaderMenu div:nth-child(2) ul#user-links.user-nav::before {
content: "OTHER";
margin-top: 15px;
}
.Header .HeaderMenu img.mr-2.header-search-key-slash {
display: none;
}
.Header ul.d-flex.pl-2.flex-items-center.text-bold.list-style-none li {
width: 100%;
}
.Header ul.d-flex.pl-2.flex-items-center.text-bold.list-style-none li:hover {
background-color: #2d333a;
}
.Header ul.d-flex.pl-2.flex-items-center.text-bold.list-style-none li a {
width: 100%;
padding: 18px 0 18px 20px !important;
font-weight: 400;
font-size: 0px !important;
}
.Header ul.d-flex.pl-2.flex-items-center.text-bold.list-style-none li a::before {
margin-right: 30px;
position: relative;
left: 4px;
opacity: 0.8;
}
.Header ul.d-flex.pl-2.flex-items-center.text-bold.list-style-none li:hover a::before {
opacity: 1;
}
.Header ul.d-flex.pl-2.flex-items-center.text-bold.list-style-none .dropdown-menu li a::before li a::before {
display: none !important;
}
.Header ul.flex-items-center.text-bold.list-style-none li {
width: 100%;
}
.Header ul.flex-items-center.text-bold.list-style-none li a {
width: 100%;
padding: 18px 0 18px 20px !important;
font-weight: 400;
font-size: 0 !important;
}
.Header:hover {
width: 200px;
box-shadow: 0px 0px 0px 1800px rgba(0, 0, 0, 0.2);
}
.Header:hover .header-logo-invertocat .octicon-mark-github {
float: unset;
height: 70px;
width: 70px;
}
.Header:hover .jump-to-field-active {
background-color: #24292e;
}
.Header:hover .jump-to-suggestions {
display: initial;
}
.Header:hover .HeaderMenu ul.d-flex.pl-2.flex-items-center.text-bold.list-style-none::before,
.Header:hover .HeaderMenu div:nth-child(1) ul#user-links.user-nav::before,
.Header:hover .HeaderMenu ul.d-lg-flex.pl-lg-2.flex-items-center.text-bold.list-style-none::before {
left: -60px;
}
.Header:hover .HeaderMenu div:nth-child(2) ul#user-links.user-nav::before {
left: -50px;
}
.Header:hover .HeaderMenu .header-search {
width: 164px !important;
left: 17px;
}
.Header:hover .HeaderMenu .user-nav .dropdown .details-overlay .name {
font-size: 15px !important;
}
.Header:hover .HeaderMenu .user-nav .dropdown .details-overlay summary.HeaderNavlink:not(.name)::after {
font-size: 15px !important;
}
.Header:hover .HeaderMenu .d-lg-flex ul li a.HeaderNavlink {
font-size: 15px !important;
}
.Header:hover .HeaderMenu ul#user-links.user-nav::before {
visibility: visible;
}
.Header:hover ul.d-flex.pl-2.flex-items-center.text-bold.list-style-none li a {
font-size: 15px !important;
}

.container-lg .col-9 .position-relative {
margin-top: 80px;
}

.page-responsive .HeaderMenu {
flex-direction: column;
width: 164px;
}

.Header ul.d-flex.pl-2.flex-items-center.text-bold.list-style-none li:nth-child(1) a::before,
.HeaderMenu .d-lg-flex ul li:nth-child(2) a::before {
content: "";
