.HeaderNavlink {
color: rgba(255, 255, 255, 0.8);
}

.HeaderNavlink:hover {
color: #fff;
}

.d-lg-flex {
flex-direction: column;
}

details.details-overlay.details-reset {
padding-left: unset !important;
padding-right: unset !important;
}

ul.d-flex.pl-2.flex-items-center.text-bold.list-style-none,
ul.d-lg-flex.pl-lg-2.flex-items-center.text-bold.list-style-none {
flex-direction: column;
padding-left: 0px !important;
margin-top: 14px;
}

.d-flex.flex-justify-between.px-3.container-lg,
.d-lg-flex.p-responsive.flex-justify-between.px-3.container-lg {
padding: 0px !important;
}

.position-relative.js-header-wrapper {
/* position: unset; */
background-color: #24292e;
}

a.notification-indicator.tooltipped.tooltipped-s.js-socket-channel.js-notification-indicator::after {
content: "Notifications";
}

ul.d-lg-flex.pl-lg-2.flex-items-center.text-bold.list-style-none {
padding-left: 0 !important;
}

/* END Main Bar */
div#js-repo-pjax-container,
.application-main > div > div {
display: flex;
}

.pagehead.repohead.instapaper_ignore.readability-menu.experiment-repo-nav {
flex-wrap: wrap;
padding-top: 0 !important;
margin: unset;
display: flex;
flex-direction: row;
background-color: #fff;
}

.application-main > div {
width: 100%;
}

/* Sidebar */
nav.reponav.js-repo-nav.js-sidenav-container-pjax,
nav.reponav.js-repo-nav.js-sidenav-container-pjax-lg {
order: 0;
display: flex !important;
flex-direction: column;
padding-top: 25px;
box-shadow: 1px 0 30px 0 rgba(0, 0, 0, 0.13);
margin: unset;
max-width: unset !important;
padding-left: unset !important;
padding-right: unset !important;
width: 100%;
}

.container-lg.new-discussion-timeline.experiment-repo-nav.p-responsive {
max-width: unset;
padding: unset !important;
flex: 2;
width: 100%;
margin-left: unset;
margin-top: 40px;
height: auto;
overflow-y: auto;
}

